    function syncdata(dateDifference) {

        var deferred = $q.defer();     
        var lastRefreshed = new Date();      
        if (isOnline == true && Offlineval == "false") {         
            $http.get('http://' + webApiHostAddress + '/API/GetMachineConnectData/' + dateDifference)
            .success(function (data) {         
                var query = "SELECT Date, jsonData FROM DayData Where Date = ?";
                $cordovaSQLite.execute(db, query, [dateDifference]).then(function (res) {
                    if (res.rows.length > 0) {
                        var query = "UPDATE DayData SET jsonData = ?, lastRefreshed=? Where Date = (?)";
                        $cordovaSQLite.execute(db, query, [JSON.stringify(data), lastRefreshed, dateDifference]).then(function (res) {
                             //alert("Datebse Updated for:" + dateDifference);
                            deferred.resolve(dateDifference);

                        }, function (err) {
                            alert("DB update Error" + JSON.stringify(err));
                            deferred.reject(dateDifference);

                        });
                    }
                    else {
                        var query = "INSERT INTO DayData (Date, jsonData,lastRefreshed) VALUES (?,?,?)";                   
                        $cordovaSQLite.execute(db, query, [dateDifference, JSON.stringify(data), lastRefreshed]).then(function (res) {
                            deferred.resolve(dateDifference);
                        }, function (err) {
                            alert(JSON.stringify(err));
                            deferred.reject(dateDifference);
                        });
                    }
                }, function (err) {
                    alert(JSON.stringify(err));
                    deferred.reject(dateDifference);

                });
            }).error(function () {
                console.log("Error while making HTTP call.");
                deferred.reject(dateDifference);
            });
        }
        else {
            deferred.resolve("Not able to connect to server.");
            $ionicPopup.alert({
                title: 'Network is Offline. Please enable WiFi/Data connection. Can not process your request now.',
            })
        }
        return deferred.promise;
    }


